#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define N 100005
#define M 100005

int n, m, cnt;
int head[N], to[M], nxt[M], val[M], id[N], vis[N], deg[N];
int p[N], q[N], top, scc_cnt, scc_id[N], scc_size[N];
int st[N], tp, dfn[N], low[N], cut[N], scc[N];

void add(int u, int v) {
    to[cnt] = v;
    val[cnt] = 1;
    nxt[cnt] = head[u];
    head[u] = cnt++;
}

void tarjan(int u) {
    dfn[u] = low[u] = ++tp;
    st[++top] = u;
    vis[u] = 1;
    for (int i = head[u]; i != -1; i = nxt[i]) {
        int v = to[i];
        if (!dfn[v]) {
            tarjan(v);
            low[u] = (low[u] < low[v]) ? low[u] : low[v];
        } else if (vis[v]) {
            low[u] = (low[u] < dfn[v]) ? low[u] : dfn[v];
        }
    }
    if (low[u] == dfn[u]) {
        scc_cnt++;
        int v;
        do {
            v = st[top--];
            vis[v] = 0;
            scc[v] = scc_cnt;
            scc_size[scc_cnt]++;
        } while (v != u);
    }
}

void dfs(int u) {
    if (scc[u] == 0) {
        scc[u] = ++scc_cnt;
        scc_size[scc_cnt] = 1;
        for (int i = head[u]; i != -1; i = nxt[i]) {
            int v = to[i];
            dfs(v);
            scc_size[scc[u]] += scc_size[scc[v]];
        }
    }
}

int main() {
    scanf("%d", &n);
    for (int i = 1; i <= n; i++) {
        head[i] = -1;
        id[i] = i;
    }
    for (int i = 1; i < n; i++) {
        int u, v;
        scanf("%d%d", &u, &v);
        add(u, v);
        add(v, u);
        deg[u]++;
        deg[v]++;
    }
    for (int i = 1; i <= n; i++) {
        if (!deg[i]) {
            p[++top] = i;
        }
    }
    while (top) {
        int u = p[top--];
        for (int i = head[u]; i != -1; i = nxt[i]) {
            int v = to[i];
            deg[v]--;
            if (!deg[v]) {
                p[++top] = v;
            }
        }
    }
    for (int i = 1; i <= n; i++) {
        if (deg[i] == 1) {
            q[++top] = i;
        }
    }
    while (top) {
        int u = q[top--];
        for (int i = head[u]; i != -1; i = nxt[i]) {
            int v = to[i];
            deg[v]--;
            if (deg[v] == 1) {
                q[++top] = v;
            }
        }
    }
    for (int i = 1; i <= n; i++) {
        if (deg[i]) {
            printf("-1\n");
            return 0;
        }
    }
    for (int i = 1; i <= n; i++) {
        if (scc[i] == 0) {
            dfs(i);
        }
    }
    for (int i = 1; i <= n; i++) {
        if (scc_size[scc[i]] != scc_size[scc[p[1]]]) {
            printf("-1\n");
            return 0;
        }
    }
    for (int i = 1; i <= n; i++) {
        if (scc[i] == scc[p[1]]) {
            printf("%d ", id[i]);
        }
    }
    for (int i = 2; i <= n; i++) {
        if (scc[i] != scc[p[1]]) {
            printf("%d ", id[i]);
        }
    }
    printf("\n");
    return 0;
}
